import React from 'react'
import './Error.css'
import Node from './PathfindingVisualizer/Node/Node.jsx'

export default function Error() {


    return (
        <div>
            <div className='Error' id='Error'>
                Error: 
            </div>
            <div className='Legend'>
                <div>
                    <Node 
                        isStart = {false}
                        isFinish= {false}
                        actualValue={0}
                    ></Node>
                    {' '} = Empty Square
                </div>
                <div>
                    <Node 
                        isStart = {true}
                        isFinish= {false}
                    ></Node>
                    {' '} = Current Square
                </div>
            </div>
        </div>
    )
}
